
import Cocoa
import Doggie

public func createImage(data rawData: UnsafeRawPointer, size: CGSize, colorSpace: CGColorSpace, bitmapInfo: UInt32) -> CGImage? {
    
    let imageWidth = Int(size.width)
    let imageHeight = Int(size.height)
    
    let bitsPerComponent: Int = 8
    let bytesPerPixel: Int = 4
    let bitsPerPixel: Int = bytesPerPixel * bitsPerComponent
    
    let bytesPerRow = bytesPerPixel * imageWidth
    
    return CGImage.create(rawData, width: imageWidth, height: imageHeight, bitsPerComponent: bitsPerComponent, bitsPerPixel: bitsPerPixel, bytesPerRow: bytesPerRow, space: colorSpace, bitmapInfo: bitmapInfo)
}

public func sampleImage(width: Int, height: Int) -> Image<ARGB32ColorPixel> {
    
    let context = ImageContext(width: width, height: height, colorSpace: CalibratedRGBColorSpace.sRGB)
    
    context.transform = SDTransform.scale(5)
    
    context.draw(shape: Shape.Ellipse(Rect(x: 10, y: 35, width: 55, height: 55)), color: Color(colorSpace: CalibratedRGBColorSpace.sRGB, color: RGBColorModel(red: 247/255, green: 217/255, blue: 12/255)), winding: .nonZero)
    
    context.draw(shape: Shape.Ellipse(Rect(x: 10, y: 35, width: 55, height: 55)).strokePath(width: 1, cap: .round, join: .round), color: Color(colorSpace: CalibratedRGBColorSpace.sRGB, color: RGBColorModel()), winding: .nonZero)
    
    context.draw(shape: Shape.Ellipse(Rect(x: 35, y: 10, width: 55, height: 55)), color: Color(colorSpace: CalibratedRGBColorSpace.sRGB, color: RGBColorModel(red: 234/255, green: 24/255, blue: 71/255)), winding: .nonZero)
    
    context.draw(shape: Shape.Ellipse(Rect(x: 35, y: 10, width: 55, height: 55)).strokePath(width: 1, cap: .round, join: .round), color: Color(colorSpace: CalibratedRGBColorSpace.sRGB, color: RGBColorModel()), winding: .nonZero)
    
    return Image(image: context.image)
}

struct Vertex : ImageContextRasterizeVertex {
    
    var position: Point
    
    var color: ColorPixel<RGBColorModel>
    
    static func + (lhs: Vertex, rhs: Vertex) -> Vertex {
        return Vertex(position: lhs.position + rhs.position, color: lhs.color + rhs.color)
    }
    
    static func * (lhs: Double, rhs: Vertex) -> Vertex {
        return Vertex(position: lhs * rhs.position, color: lhs * rhs.color)
    }
}

public func sampleImage3(width: Int, height: Int) -> Image<ARGB32ColorPixel> {
    
    let context = ImageContext(width: 500, height: 500, colorSpace: CalibratedRGBColorSpace.sRGB)
    
    func shader(vertex: Vertex) -> ColorPixel<RGBColorModel> {
        
        return vertex.color
    }
    
    let triangle = (Vertex(position: Point(x: 50, y: 50), color: ColorPixel(red: 1, green: 0, blue: 0, opacity: 1)),
                    Vertex(position: Point(x: 450, y: 50), color: ColorPixel(red: 0, green: 1, blue: 0, opacity: 1)),
                    Vertex(position: Point(x: 450, y: 450), color: ColorPixel(red: 0, green: 0, blue: 1, opacity: 1)))
    
    context.rasterize(CollectionOfOne(triangle), shader: shader)
    
    return Image(image: context.image)
}

struct Vertex2 : ImageContextRasterizeVertex {
    
    var position: Vector
    
    var color: ColorPixel<RGBColorModel>
    
    static func + (lhs: Vertex2, rhs: Vertex2) -> Vertex2 {
        return Vertex2(position: lhs.position + rhs.position, color: lhs.color + rhs.color)
    }
    
    static func * (lhs: Double, rhs: Vertex2) -> Vertex2 {
        return Vertex2(position: lhs * rhs.position, color: lhs * rhs.color)
    }
}

public func sampleImage4(width: Int, height: Int) -> Image<ARGB32ColorPixel> {
    
    let context = ImageContext(width: 500, height: 500, colorSpace: CalibratedRGBColorSpace.sRGB)
    
    let matrix = Matrix.rotateY(degreesToRad(30)) * Matrix.rotateX(degreesToRad(30)) * Matrix.translate(x: 0, y: 0, z: -100)
    
    let c0 = ColorPixel(red: 0, green: 0, blue: 0, opacity: 1)
    let c1 = ColorPixel(red: 1, green: 0, blue: 0, opacity: 1)
    let c2 = ColorPixel(red: 0, green: 1, blue: 0, opacity: 1)
    let c3 = ColorPixel(red: 0, green: 0, blue: 1, opacity: 1)
    let c4 = ColorPixel(red: 1, green: 1, blue: 0, opacity: 1)
    let c5 = ColorPixel(red: 1, green: 0, blue: 1, opacity: 1)
    let c6 = ColorPixel(red: 0, green: 1, blue: 1, opacity: 1)
    let c7 = ColorPixel(red: 1, green: 1, blue: 1, opacity: 1)
    
    let v0 = Vertex2(position: Vector(x: 25, y: 25, z: 25) * matrix, color: c0)
    let v1 = Vertex2(position: Vector(x: -25, y: 25, z: 25) * matrix, color: c1)
    let v2 = Vertex2(position: Vector(x: -25, y: -25, z: 25) * matrix, color: c5)
    let v3 = Vertex2(position: Vector(x: 25, y: -25, z: 25) * matrix, color: c3)
    let v4 = Vertex2(position: Vector(x: 25, y: 25, z: -25) * matrix, color: c2)
    let v5 = Vertex2(position: Vector(x: -25, y: 25, z: -25) * matrix, color: c4)
    let v6 = Vertex2(position: Vector(x: -25, y: -25, z: -25) * matrix, color: c7)
    let v7 = Vertex2(position: Vector(x: 25, y: -25, z: -25) * matrix, color: c6)
    
    // face v0, v1, v2, v3
    let t0 = (v0, v1, v2)
    let t1 = (v0, v2, v3)
    
    // face v7, v6, v5, v4
    let t2 = (v7, v6, v5)
    let t3 = (v7, v5, v4)
    
    // face v4, v0, v3, v7
    let t4 = (v4, v0, v3)
    let t5 = (v4, v3, v7)
    
    // face v1, v5, v6, v2
    let t6 = (v1, v5, v6)
    let t7 = (v1, v6, v2)
    
    // face v0, v4, v5, v1
    let t8 = (v0, v4, v5)
    let t9 = (v0, v5, v1)
    
    // face v7, v3, v2, v6
    let t10 = (v7, v3, v2)
    let t11 = (v7, v2, v6)
    
    func shader(vertex: Vertex2) -> ColorPixel<RGBColorModel> {
        
        return vertex.color
    }
    
    let triangles = [t0, t1, t2, t3, t4, t5, t6, t7, t8, t9, t10, t11]
    
    context.rasterize(triangles, projection: PerspectiveProjectMatrix(angle: degreesToRad(50), nearZ: 0, farZ: -500), culling: .back, shader: shader)
    
    return Image(image: context.image)
}

